import styled from "styled-components";

export const HeaderEstilizado = styled.div`
  background-color: orange;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 50px;
  height: 10%;
`

export const Titulo = styled.h1`
background-color: blue;
`
